import Link from 'next/link';
import styles from './Header.module.css'


const linkStyle = {
  marginRight: 30
};

const Header = () => (
  <div className={styles.header}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);


export default Header;
